import Modal from '@material-ui/core/Modal';

const Side=()=>{ 
    return(
        <>
        <div style={{width:"24px",height:"126px",backgroundColor:"black","position":"absolute","top":"200px","right":"0px","borderRadius":"6px 0 0 6px"}}>
            <h5 style={{transform:"rotate(90deg)",color:"white",marginTop:"20px"}}>
            <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="simple-modal-title"
        aria-describedby="simple-modal-description"
      >
      </Modal></h5>
        </div>
        </>
    );
}


export default Side;
